import React, { useState } from 'react';
import { NLink } from 'react-router-dom';
import './style.scss';

export default function Navbar() {

  return(
    <div className="navbar">
        <ul className="menu-navbar">
            <li className="menu-navbar__link"><NLink to="/">Home</NLink></li>
            <li className="menu-navbar__link"><NLink to="/About">About</NLink></li>
            <li className="menu-navbar__link"><NLink to="/">Logo</NLink></li>
            <li className="menu-navbar__link"><NLink to="/Work">Work</NLink></li>
            <li className="menu-navbar__link"><NLink to="/Contact">Contact</NLink></li>
        </ul>
    </div>
   )

 }
